import './public/js/bootstrap.min.js';
import './public/js/jquery.magnific-popup.js';
import './public/js/jquery.firstVisitPopup.js';
import './public/js/custom.js';


import Home from './pages/Home';

function App() {
  return (
    <div className="App">

      <Home />
    </div>
  );
}

export default App;
